import React, {Component} from "react";

class Story extends Component {
    render(){
        const {title, story, url} = this.props
        return(
            <div className="story">
                <img onError={this.src="../images/fallback.jpg"} src={url} />
                <h2>{title}</h2>
                <p>{story}</p>
            </div>
        );
    }
}

export default Story;
